public static void createConfigurationDirectory(){
  String home=System.getProperty("user.home");
  String sep=System.getProperty("file.separator");
  File f=new File(home + sep + "lf5");
  if (!f.exists()) {
    try {
      f.mkdir();
    }
 catch (    SecurityException e) {
      e.printStackTrace();
    }
  }
}

